import styled from 'styled-components';

const AboutContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 4rem 2rem;
`;

const About = () => {
  return (
    <AboutContainer>
      <h1>About Us</h1>
      <p>Welcome to Cypherbox Data Center</p>
    </AboutContainer>
  );
};

export default About;
